import React from "react";
import { Link } from "react-router-dom";

function PostList({ posts }) {
  return (
    <ul>
      {posts.map((post) => (
        <li key={post.id}>
          <Link to={`/${post.id}`} />
          {post.title}
        </li>
      ))}
    </ul>
  );
}

export default PostList;
